function Navbar() {
  return (
    <nav className="navbar">
      <div className="container">
        <a href="#">Hulk</a>

        <a href="#" className="logo is-active">
          Mavel
        </a>
        <a href="#">Venom</a>
      </div>

      <style jsx>
        {`
          .navbar {
            width: 100%;
            height: 8rem;
            background-color: red;
            position: fixed;
  left: 0;
  top: 0;
  z-index: 99;
  box-shadow: 0px 6px 8px rgba(0, 0, 0, 0.5);
          }
          
          
        `}
      </style>
    </nav>
  );
}
export default Navbar;
